<script>

var cwMarkers;

cyMarkersHideEdges = function(){
   cwMarkers.filter('edge').hide()
   }

cyMarkersShowEdges = function(){
   cwMarkers.filter('edge').show()
   }

cyMarkersZoomSelected = function() {
   cwMarkers.fit(cwMarkers.$(':selected'), 100)
   }

cyMarkersShowEdgesFromSelectedNodes = function(){
   var selectedNodes = cwMarkers.filter('node:selected');
   for(var n=0; n < selectedNodes.length; n++){
      node = selectedNodes[n];
      nodeID = node.data().id;
      filterString = "[target='" + nodeID + "']";
      cwMarkers.edges(filterString).show()
      filterString = "[source='" + nodeID + "']";
      cwMarkers.edges(filterString).show();
      node.neighborhood().select();
     } // for n
   } // addEdgesBetweenSelectedNodes


//----------------------------------------------------------------------------------------------------
markersAndTissuesHandleWindowResize = function()
{
   console.log("markersAndTissues window resize: " + $(window).width() + ", " + $(window).height());

   $("#cyMarkersDiv").width(0.95 * $(window).width());
   $("#cyMarkersDiv").height(0.8 * $(window).height());

   cwMarkers.resize();
   cwMarkers.fit(50);

} // markersAndTissuesHandleWindowResize
//----------------------------------------------------------------------------------------------------
handleTissueIDsForMarkersAndTissues = function(msg)
{
   console.log("=== entering handleTissueIDsForMakersAndTissues");
   console.log("status: " + msg.status);
   tissueIDCount = msg.payload.count;
   tissueIDs = msg.payload.tissueIDs;
   console.log("count: " + tissueIDCount + "  ids: " + tissueIDs);

   if(tissueIDCount == 1)
      tissueIDs = [tissueIDs];



   for(var i=0; i < tissueIDs.length; i++){
      nodeName = tissueIDs[i];
      s = "cwMarkers.filter('node[name=\"" + nodeName + "\"]').select()"; 
      console.log("-- about to run: " + s);
      eval (s);
      } // for i

    $("#tabs").tabs( "option", "active", 1);

} // handleTissueIDsForMarkersAndTissues
//----------------------------------------------------------------------------------------------------
loadMarkersAndTissuesNetwork = function() {

   console.log("loadMarkersAndTissuesNetwork, node count: " + network.elements.nodes.length);
   cwMarkers = $("#cyMarkersDiv");
   cwMarkers.cytoscape({
       elements: network.elements,
       style: vizmap[0].style,
       showOverlay: false,
       minZoom: 0.01,
       maxZoom: 8.0,
       layout: {
         name: "preset",
         fit: true
         },
    ready: function() {
        console.log("cwMarkers ready");
        cwMarkers = this;
        cwMarkers.filter('edge').hide();  // no edges at first
        cwMarkers.on('mouseover', 'node', function(evt){
           var node = evt.cyTarget;
           $("#markersAndSamplesMouseOverReadoutDiv").text(node.data().canonicalName)
           })
        console.log("cwMarkers.reset")
        cwMarkers.reset()
        cwMarkers.fit(50);
        markersAndTissuesHandleWindowResize();
        }, // cy.ready

    stylehidden: cytoscape.stylesheet()
      .selector('node')
         .css({'background-color': 'blue'})
      .selector('edge')
         .css({'line-color': 'green',
               'source-arrow-shape': 'circle',
               'source-arrow-color': 'red',
               'curve-style': 'bezier'
              })
       })
    .cytoscapePanzoom({ });   // need to learn about options

} // loadMarkersAndTissuesNetwork
//----------------------------------------------------------------------------------------------------
onReadyFunctions.push(function() {
   console.log("==== markersAndTissues code.js document ready");
   $("#cyMarkersHideEdgesButton").click(cyMarkersHideEdges);
   $("#cyMarkersShowEdgesButton").click(cyMarkersShowEdges);
   $("#cyMarkersShowEdgesFromSelectedButton").click(cyMarkersShowEdgesFromSelectedNodes);
   $("#cyMarkersZoomSelectedButton").click(cyMarkersZoomSelected);
   console.log("about to push loadNetwork");
   socketConnectedFunctions.push(loadMarkersAndTissuesNetwork)
   addJavascriptMessageHandler("tissueIDsForMarkersAndTissues", handleTissueIDsForMarkersAndTissues);
   $(window).resize(markersAndTissuesHandleWindowResize);
   }); // document.ready
//----------------------------------------------------------------------------------------------------

</script>

<script>
//--------------------------------------------------------------------------------------------------
function getRandomFloat (min, max)
{
    return Math.random() * (max - min) + min;
}
//----------------------------------------------------------------------------------------------------
function getRandomInt (min, max) 
{
    return Math.floor(Math.random() * (max - min + 1)) + min;
}
//----------------------------------------------------------------------------------------------------
dispatchMessage = function(msg)
{
   console.log("--- webapp, index.common, dispatchMessage: " + msg.cmd);

   if (dispatchOptions[msg.cmd])
       dispatchOptions[msg.cmd](msg)
   else
      console.log("unrecognized socket request: " + msg.cmd);
} 
//--------------------------------------------------------------------------------------------------
setupSocket = function (socket)
{
  try {
     socket.onopen = function() {
        console.log("websocket connection now open");
        for(var f=0; f < socketConnectedFunctions.length; f++){
           console.log("calling the next sockectConnectedFunction");
           socketConnectedFunctions[f]();
           } // for f
        } 
     socket.onmessage = function got_packet(msg) {
        msg = JSON.parse(msg.data)
        console.log("index.common onmessage sees " + msg.cmd);
        dispatchMessage(msg)
        } // socket.onmessage, got_packet
     socket.onclose = function(){
        //$("#status").text(msg.cmd)
        console.log("socket closing");
        } // socket.onclose
    } // try
  catch(exception) {
    $("#status").text("Error: " + exception);
    }

} // setupSocket
//----------------------------------------------------------------------------------------------------
function invokeSuccess(r)
{
    socket.rserveExecuting = false;

    if (r.errors.length > 0)
    {
        for (var i=0; i < r.errors.length; i++)
        {
        $("#status").text("Error: " + r.errors[i]);
        }
    }
    else
    if (r.outputParams.length > 0)
    {
        // note that LabKey has handled the JSON parsing already
        var msg = r.outputParams[0].value;
        console.log("index.common onmessage sees " + msg.cmd);
        dispatchMessage(msg);
    }

    //
    // call the next pending command if available
    //
    if (socket.rservePendingCommands.length > 0)
    {
        // note that M4 macro language uses 'shift' so quote it below
        executeRserveCommand(socket.rservePendingCommands.shift());
    }
}
//----------------------------------------------------------------------------------------------------
function invokeFailure(error)
{
    $("#status").text("Error: " + error.exception);
}
//----------------------------------------------------------------------------------------------------
function executeRserveCommand(data)
{
    if (socket.rserveExecuting)
    {
        //
        // put this command on our pending list and execute when the server has responded.
        //

        //console.log("in executeRserveCommand - pending:" + data);
        socket.rservePendingCommands.push(data);
    }
    else
    {
        //
        // execute immediately
        //
        socket.rserveExecuting = true;

        //console.log("in executeRserveCommand - executing:" + data);
        LABKEY.Report.execute( {
            success: invokeSuccess,
            failure: invokeFailure,
            script : 'invokeCommand',
            reportSessionId : socket.rserveSession,
            inputParams : { DATA : data }
        });
    }
}
//----------------------------------------------------------------------------------------------------
// todo: investigate why json returned by LabKey is creating array[1] in some cases.
// both JSON.parse and the LabKey util decode function do this
//----------------------------------------------------------------------------------------------------
function flattenArrays(d)
{
    for (var key in d)
    {
        if (d.hasOwnProperty(key))
        {
            var val = d[key];
            if ((val instanceof Array) && val.length == 1)
            {
                d[key] = val[0];
            }
        }
    }
}
//----------------------------------------------------------------------------------------------------
setupLabKey = function(socket)
{
    // replace socket send for LabKey
    socket.send = executeRserveCommand;
    socket.rservePendingCommands = [];
    socket.rserveExecuting = false;
    socket.rserveSession = labkey.reportSession;
    console.log("rserveSession:  " + labkey.reportSession);

    // kick off init functions
    for(var f=0; f < socketConnectedFunctions.length; f++)
    {
        console.log("calling the next sockectConnectedFunction");
        socketConnectedFunctions[f]();
    }
}

function setupFilteredPatients()
{
    if (typeof labkey != "undefined" && labkey.filteredPatients)
    {
        filteredPatients = labkey.filteredPatients.split(';');
        console.log("==== filteredPatients: " + filteredPatients.length)
    }
}
//--------------------------------------------------------------------------------------------------
$(document).ready(function()
{
    console.log("==== index.common document.ready #1");

    for (var f = 0; f < onReadyFunctions.length; f++)
    {
        console.log("calling on ready function");
        onReadyFunctions[f]();
    }

    //
    // labkeyMode has three states:
    // undefined - labkey not involved
    // labkeyWS - labkey launched Oncoscape; local R must be run with WS
    // labkeyRS - labkey launched oncoscape; Rserve is used
    //
    if (typeof labkey == "undefined")
    {
        socket = new WebSocket("ws://" + window.location.host);
        setupSocket(socket);
    }
    else
    if (labkey.mode == "WS")
    {
        socket = new WebSocket("ws://localhost:7777/");
        setupSocket(socket);
    }
    else
    if (labkey.mode == "RS")
    {
        socket = {};
        setupLabKey(socket);
    }
    else
    {
        console.log("unrecognized labkey.mode was provided: " + labkey.mode);
    }

    // todo: probably a better place to put this
    setupFilteredPatients();
})
//--------------------------------------------------------------------------------------------------
</script>
